import React from "react";
import StartProcess from "./StartProcess";
import Filters from "./Filters";
import ProcessTable from "./ProcessTable";
import TableHead from "./TableHead";
import TableRows from "./TableRows";

import Table from "react-bootstrap/Table";

const Dashboard = ({
  details,
  filterProcesses,
  processes,
  tableHeadDetails,
  filters,
}) => {
  return (
    <div>
      <div className="container">
        <StartProcess details={details} />

        <Filters filterProcesses={filterProcesses} processes={processes} />
        {/* 
          <ProcessTable
            processes={processes}
            running={true}
            filters={filterProcesses}
            details={tableHeadDetails}
          /> */}

        <Table responsive striped bordered hover className="text-center">
          <TableHead details={tableHeadDetails} />
          <TableRows processes={processes} running={true} filters={filters} />
        </Table>
      </div>
    </div>
  );
};

export default Dashboard;
